import { jsx, jsxs } from 'react/jsx-runtime';
import { useState, useRef, useImperativeHandle, useMemo, useEffect, createElement } from 'react';
import html2pdf from 'html2pdf.js';

var img = "data:image/png;base64,";

const Html2PdfCerts = (props) => {
    const { handler, onGenerated = () => { }, onStartGenerate = () => { }, onEndGenerate = () => { }, rows = [], filename = 'myfile.pdf', margin = 0, enableLinks = true, format = [1600, 899], orientation = 'landscape', unit = 'px', imageUrl, transformationScale = 0.5, backgroundColor = 'yellowgreen', sizeStyle, } = props;
    const [pendingShot, setPendingShot] = useState(false);
    const divRef = useRef(null);
    const generatePdf = async () => {
        onStartGenerate();
        setPendingShot(true);
    };
    const buildPdf = async () => {
        console.log('calls generatePdf method');
        const worker = new html2pdf.Worker();
        const opt = {
            margin,
            filename,
            image: { type: 'jpeg', quality: 1.0 },
            html2canvas: { scale: 2 },
            enableLinks,
            jsPDF: { unit, format, orientation },
            // jsPDF:        { unit: 'in', format: 'letter', orientation: 'landscape' }
        };
        // [1600, 899]
        worker
            .set(opt)
            .from(divRef.current)
            .toPdf()
            .output('blob').then((data) => {
            console.log('blob data', data);
            onGenerated(data);
            return data;
        })
            .save().then(() => {
            setPendingShot(false);
            onEndGenerate();
        });
    };
    const parseContent = (content) => {
        if (Array.isArray(content)) {
            return content.map((row) => parseRow(row));
        }
        return (content || '').toString();
    };
    const parseRow = (row) => {
        switch (row.type) {
            case 'text':
                return parseContent(row.content);
            case 'break':
                if (typeof row.times !== 'number')
                    return jsx("br", {});
                return Array.from({ length: row.times }, (_, index) => jsx("br", {}, index));
            case 'h1':
            case 'h2':
            case 'h3':
            case 'h4':
                return createElement(row.type, {}, parseContent(row.content));
            default:
                return jsxs("p", { children: ["Unknown element type ", row.type] });
        }
    };
    useImperativeHandle(handler, () => {
        return {
            generatePdf,
        };
    });
    const stylesForScale = useMemo(() => ({
        transform: `scale(${transformationScale || 0.5})`,
        transformOrigin: 'top left',
    }), [transformationScale]);
    useEffect(() => {
        if (pendingShot) {
            buildPdf();
        }
    }, [pendingShot]);
    return (jsx("div", { style: {
            backgroundColor,
            backgroundImage: `url(${imageUrl || img})`,
            ...(sizeStyle ? {
                width: typeof sizeStyle.width === 'number' ? `${sizeStyle.width}px` : sizeStyle.width,
                height: typeof sizeStyle.height === 'number' ? `${sizeStyle.height}px` : sizeStyle.height,
            } : undefined),
            ...(pendingShot ? {} : stylesForScale)
        }, ref: divRef, className: "html-2-pdf-certs", children: rows.map((row) => parseRow(row)) }));
};

export { Html2PdfCerts };
